import './css/App.css';
import Header from './components/Header';
import Main from './components/Main';
import { BrowserRouter } from 'react-router-dom'

function App() {
  return (
    <BrowserRouter className="App">
      <header className="App-header">
       <Header></Header>
      </header>

      <main>
          <Main></Main>
      </main>

      <footer>
          <h2>DESENVOLVIDO POR JOAO MANOEL</h2>
      </footer>
    </BrowserRouter>
  );
}

export default App;
